class MutualFundParser {
  private dailyData: any[];
  private metaData: any[];
  private nfoData: any[];
  allFunds: any[];

  private DAILY = {
    SYMBOL: 0,
    PURCHASE_ALLOWED: 1,
    REDEMPTION_ALLOWED: 2,
    LAST_DIVIDEND_DATE: 3,
    LAST_DIVIDEND_PERCENT: 4,
    NAV: 5,
    NAV_DATE: 6,
    CHANGE_PERCENT: 7,
    ONE_YEAR: 8,
    TWO_YEAR: 9,
    THREE_YEAR: 10,
    FOUR_YEAR: 11,
    FIVE_YEAR: 12,
    AUM_CRORE: 13,
  };

  private META = {
    SYMBOL: 0,
    AMC: 1,
    FUND_NAME: 2,
    MIN_PURCHASE: 3,
    PURCHASE_MULTIPLE: 4,
    MIN_ADDITIONAL_PURCHASE: 5,
    MIN_REDEEM_QTY: 6,
    REDEEM_MULTIPLE: 7,
    DIVIDEND_TYPE: 8,
    DIVIDEND_INTERVAL: 9,
    SCHEME: 10,
    SUB_SCHEME: 11,
    IS_DIRECT: 12,
    SETTLEMENT_TYPE: 13,
    LAUNCH_DATE: 14,
    EXIT_LOAD: 15,
    EXIT_LOAD_SLAB: 16,
    EXPENSE_RATIO: 17,
    SIP_FLAG: 18,
    MANAGER_NAME: 19,
    LOCKIN: 20,
    RISK: 21,
  };

  constructor({
    dailyData,
    metaData,
    nfoData,
  }: {
    dailyData?: any[];
    metaData?: any[];
    nfoData?: any[];
  }) {
    this.dailyData = dailyData || [];
    this.metaData = metaData || [];
    this.nfoData = nfoData || [];
    this.allFunds = [];

    this.parse();
  }

  private stripPlan(name: string): string {
    return name
      ?.replace("  ", " ")
      ?.replace(" - Direct Plan", "")
      ?.replace(" - Regular Plan", "");
  }

  private formatDividend(type: string, interval: string): string {
    if (type === "G") return "Growth";
    if (type === "P")
      return interval
        ? `Dividend ${interval.toLowerCase()} payout`
        : "Dividend payout";
    if (type === "R") return "Dividend reinvest";
    return interval || type || "";
  }

  private slugify(str: string): string {
    return str
      ?.toLowerCase()
      ?.replace(/[^\w\s-]/g, "")
      ?.replace(/\s+/g, "-")
      ?.trim();
  }

  // -----------------------------------------------------------------------
  // MAIN PARSER  returns ONE LIST where each object has ALL possible fields
  // -----------------------------------------------------------------------
  private parse(): any[] {
    const { DAILY, META } = this;

    // Map meta by trading symbol
    const metaMap = new Map(this.metaData.map((m: any) => [m[META.SYMBOL], m]));

    // Map daily by symbol
    const dailyMap = new Map(
      this.dailyData.map((d: any) => [d[DAILY.SYMBOL], d])
    );

    // Final unique map by tradingSymbol
    const combinedMap = new Map();

    // -------------------------------------------------------------------
    // 1) MERGE daily + meta into full objects
    // -------------------------------------------------------------------
    for (const daily of this.dailyData) {
      const symbol = daily[DAILY.SYMBOL];
      const meta = metaMap.get(symbol) || null;

      const item = this.buildFullObject(symbol, daily, meta, null);
      combinedMap.set(symbol, item);
    }

    // -------------------------------------------------------------------
    // 2) ADD meta-only items (rare but safe)
    // -------------------------------------------------------------------
    for (const meta of this.metaData) {
      const symbol = meta[META.SYMBOL];

      if (!combinedMap.has(symbol)) {
        const daily = null;
        const item = this.buildFullObject(symbol, daily, meta, null);
        combinedMap.set(symbol, item);
      }
    }

    // -------------------------------------------------------------------
    // 3) ADD NFO items (normalize to same shape)
    // -------------------------------------------------------------------
    for (const nfo of this.nfoData) {
      const symbol = nfo[0];

      if (!combinedMap.has(symbol)) {
        const item = this.buildFullObject(symbol, null, null, nfo);
        combinedMap.set(symbol, item);
      }
    }

    // Final list
    this.allFunds = [...combinedMap.values()];
    return this.allFunds;
  }

  // -----------------------------------------------------------------------
  // Build a full mutual fund object from daily/meta/nfo
  // -----------------------------------------------------------------------
  private buildFullObject(symbol: any, daily: any, meta: any, nfo: any): any {
    const d = this.DAILY;
    const m = this.META;

    const isNfo = !!nfo;

    // Extract from meta
    const fundName = this.stripPlan(meta?.[m.FUND_NAME] || nfo?.[1] || "");
    const plan = meta?.[m.IS_DIRECT] === 1 ? "Direct" : meta ? "Regular" : null;

    const dividendType = meta?.[m.DIVIDEND_TYPE] || null;
    const dividendInterval = meta
      ? this.formatDividend(meta[m.DIVIDEND_TYPE], meta[m.DIVIDEND_INTERVAL])
      : null;

    const amc = meta?.[m.AMC] || nfo?.[1] || null;

    return {
      // IDENTIFIERS
      tradingSymbol: symbol,
      fundSlug: this.slugify(
        `${fundName || ""} ${plan || ""} ${dividendInterval || ""}`
      ),

      // BASIC INFO
      fund: fundName,
      amc,
      hex_code: amc ? amc_lookup[amc as keyof typeof amc_lookup] : null,
      scheme: meta?.[m.SCHEME] || nfo?.[10] || null,
      subScheme: meta?.[m.SUB_SCHEME] || null,
      plan: plan,

      // PURCHASE/REDEMPTION
      purchaseAllowed: daily ? daily[d.PURCHASE_ALLOWED] === 1 : false,
      redemptionAllowed: daily ? daily[d.REDEMPTION_ALLOWED] === 1 : false,

      // DIVIDEND
      dividendType,
      dividendInterval,
      lastDividendDate: daily?.[d.LAST_DIVIDEND_DATE] || null,
      lastDividendPercent: daily?.[d.LAST_DIVIDEND_PERCENT] || null,

      // NAV
      nav: daily?.[d.NAV] || null,
      navDate: daily?.[d.NAV_DATE] || null,
      changePercent: daily?.[d.CHANGE_PERCENT] || null,

      // RETURNS
      oneYearReturn: daily?.[d.ONE_YEAR] || null,
      twoYearReturn: daily?.[d.TWO_YEAR] || null,
      threeYearReturn: daily?.[d.THREE_YEAR] || null,
      fourYearReturn: daily?.[d.FOUR_YEAR] || null,
      fiveYearReturn: daily?.[d.FIVE_YEAR] || null,

      // AUM
      aum: daily ? daily[d.AUM_CRORE] * 1e7 : null,

      // INVESTMENT INFO
      minPurchaseAmount: meta?.[m.MIN_PURCHASE] || nfo?.[2] || null,
      maxPurchaseAmount: nfo?.[3] || null,
      purchaseMultiple: meta?.[m.PURCHASE_MULTIPLE] || nfo?.[4] || null,
      minAdditionalPurchase: meta?.[m.MIN_ADDITIONAL_PURCHASE] || null,
      minRedeemQty: meta?.[m.MIN_REDEEM_QTY] || null,
      redeemMultiple: meta?.[m.REDEEM_MULTIPLE] || null,

      // META-only fields
      settlementType: meta?.[m.SETTLEMENT_TYPE] || null,
      launchDate: meta?.[m.LAUNCH_DATE] || nfo?.[6] || null,
      exitLoad: meta?.[m.EXIT_LOAD] || null,
      exitLoadSlab: meta?.[m.EXIT_LOAD_SLAB] || null,
      expenseRatio: meta?.[m.EXPENSE_RATIO] || null,
      sipAllowed: meta?.[m.SIP_FLAG] === 1,
      manager: meta?.[m.MANAGER_NAME] || null,
      lockIn: meta?.[m.LOCKIN] || null,
      risk: meta?.[m.RISK] || null,

      // NFO specific
      nfoSidLink: nfo?.[5] || null,
      nfoStartDate: nfo?.[6] || null,
      nfoStartTime: nfo?.[7] || null,
      nfoFundType: nfo?.[12] || null,
      nfoIsActive: nfo?.[13] || null,

      // Flags
      isNFO: isNfo,
    };
  }

  // -----------------------------------------------------------------------
  // SEARCH FUNCTION  match tradingSymbol & fund name (max 15)
  // -----------------------------------------------------------------------
  search(query: string): any[] {
    if (!query) return [];

    const queryWords = query.toLowerCase().split(/\s+/).filter(Boolean);

    const results = this.allFunds.filter((f) => {
      const symbolLower = f.tradingSymbol?.toLowerCase() || "";
      const fundLower = f.fund?.toLowerCase() || "";
      const combinedText = `${symbolLower} ${fundLower}`;

      // Check if all query words match in the combined text
      return queryWords.every((word) => combinedText.includes(word));
    });

    return results.slice(0, 15);
  }
}

const mutualFunds = new MutualFundParser({
  dailyData: fund_details.n9,
  metaData: fund_info.n9,
  nfoData: fund_details.Ol || [],
});

export default mutualFunds;
